import React from 'react';

function Instruction() {
    return (
        <div>
        <h1>
            Instruction on how to play
        </h1>
        <h2>Easy game</h2>
            <p>Try to guess the correct 5 letter words in 7 prompts!</p>

        <h2>Medium game</h2>
            <p>Try to guess the correct 6 letter words in 6 prompts! </p>

        <h2>Hard game</h2>
        <p>Try to guess the correct 7 letter words in only 5 prompts! </p>
        </div>
    ); 
}

export default Instruction;
